  seeMore: {
    marginTop: theme.spacing(3),
  },
}));

export default function Query() {
  const classes = useStyles();

  return (
    <TextField
      id="standard-full-width"
      label="Enter Query"
      style={{ margin: 8 }}
      placeholder="Placeholder"
      helperText="helper text"
      fullWidth
      margin="normal"
      InputLabelProps={{
        shrink: true,
      }}
    />
  );
}
